import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Results.css';  // Make sure you have the corresponding CSS file

const Results = () => {
    const navigate = useNavigate();
    const [results, setResults] = useState(null);

    useEffect(() => {
        // Get the stored results from localStorage
        const storedResults = localStorage.getItem('results');
        if (storedResults) {
            setResults(JSON.parse(storedResults));
        } else {
            // Navigate to the homepage if no results are found
            navigate('/');
        }
    }, [navigate]);

    return (
        <div className="results-container">
            <h2>Results</h2>
            {results ? (
                <div className="results-content">
                    <p><strong>Stress Score:</strong> {results.stressScore}</p>
                    <p><strong>Anxiety Score:</strong> {results.anxietyScore}</p>
                    <p><strong>Depression Score:</strong> {results.depressionScore}</p>
                </div>
            ) : (
                <p>Loading results...</p>
            )}
        </div>
    );
};

export default Results;
